import { useState } from 'react';
import styled from '@emotion/styled';

const GiftRanking = () => {
  const [filter, setFilter] = useState('all');
  const [showMore, setShowMore] = useState(false);

  const items = [
    { id: 1, rank: 1, name: 'BBQ 양념치킨+크림치즈볼+콜라1.25L', price: 29000, image: 'url/to/image1.png' },
    { id: 2, rank: 2, name: 'BBQ 양념치킨+크림치즈볼+콜라1.25L', price: 29000, image: 'url/to/image2.png' },
    { id: 3, rank: 3, name: 'BBQ 양념치킨+크림치즈볼+콜라1.25L', price: 29000, image: 'url/to/image3.png' },
    { id: 4, rank: 4, name: 'BBQ 양념치킨+크림치즈볼+콜라1.25L', price: 29000, image: 'url/to/image4.png' },
    { id: 5, rank: 5, name: 'BBQ 양념치킨+크림치즈볼+콜라1.25L', price: 29000, image: 'url/to/image5.png' },
    { id: 6, rank: 6, name: 'BBQ 양념치킨+크림치즈볼+콜라1.25L', price: 29000, image: 'url/to/image6.png' },
    // 추가 아이템들
  ];

  const displayedItems = showMore ? items : items.slice(0, 6);

  return (
    <RankingContainer>
      <Title>실시간 급상승 선물랭킹</Title>
      <FilterContainer>
        <FilterButton onClick={() => setFilter('all')} active={filter === 'all'}>전체</FilterButton>
        <FilterButton onClick={() => setFilter('female')} active={filter === 'female'}>여성이</FilterButton>
        <FilterButton onClick={() => setFilter('male')} active={filter === 'male'}>남성이</FilterButton>
        <FilterButton onClick={() => setFilter('teen')} active={filter === 'teen'}>청소년이</FilterButton>
      </FilterContainer>
      <SubFilterContainer>
        <SubFilterButton active>받고 싶어한</SubFilterButton>
        <SubFilterButton active>많이 선물한</SubFilterButton>
        <SubFilterButton active>위시로 받은</SubFilterButton>
      </SubFilterContainer>
      <ItemsContainer>
        {displayedItems.map(item => (
          <Item key={item.id}>
            <Rank>{item.rank}</Rank>
            <Image src={item.image} alt={item.name} />
            <Name>{item.name}</Name>
            <Price>{item.price.toLocaleString()}원</Price>
          </Item>
        ))}
      </ItemsContainer>
      <ButtonContainer>
        {showMore ? (
          <Button onClick={() => setShowMore(false)}>접기</Button>
        ) : (
          <Button onClick={() => setShowMore(true)}>더보기</Button>
        )}
      </ButtonContainer>
    </RankingContainer>
  );
};

const RankingContainer = styled.div`
  padding: 20px;
  background-color: #fff;
  border-radius: 8px;
`;

const Title = styled.h2`
  font-size: 18px;
  font-weight: bold;
  margin-bottom: 20px;
`;

const FilterContainer = styled.div`
  display: flex;
  gap: 10px;
  margin-bottom: 20px;
`;

const FilterButton = styled.button<{ active: boolean }>`
  padding: 10px 20px;
  border: none;
  border-radius: 20px;
  background-color: ${({ active }) => (active ? '#007aff' : '#e0e0e0')};
  color: ${({ active }) => (active ? '#fff' : '#333')};
  cursor: pointer;
`;

const SubFilterContainer = styled.div`
  display: flex;
  gap: 10px;
  margin-bottom: 20px;
`;

const SubFilterButton = styled.button<{ active: boolean }>`
  padding: 5px 10px;
  border: none;
  border-radius: 10px;
  background-color: ${({ active }) => (active ? '#e0e0e0' : '#fff')};
  color: #007aff;
  cursor: pointer;
`;

const ItemsContainer = styled.div`
  display: flex;
  flex-wrap: wrap;
  gap: 20px;
`;

const Item = styled.div`
  width: 200px;
  padding: 10px;
  border: 1px solid #e0e0e0;
  border-radius: 8px;
  text-align: center;
`;

const Rank = styled.div`
  position: absolute;
  top: 10px;
  left: 10px;
  background-color: #ff3b30;
  color: #fff;
  padding: 5px 10px;
  border-radius: 50%;
  font-weight: bold;
`;

const Image = styled.img`
  width: 100%;
  height: auto;
  border-radius: 8px;
  margin-bottom: 10px;
`;

const Name = styled.p`
  font-size: 14px;
  margin-bottom: 10px;
`;

const Price = styled.p`
  font-size: 16px;
  font-weight: bold;
  margin-bottom: 10px;
`;

const ButtonContainer = styled.div`
  text-align: center;
  margin-top: 20px;
`;

const Button = styled.button`
  padding: 10px 20px;
  border: none;
  border-radius: 20px;
  background-color: #007aff;
  color: #fff;
  cursor: pointer;
`;

export default GiftRanking;
